"use strict";$(document).ready(function(){$(".sweet-basic").on("click",function(){swal("Hello world!")});$(".sweet-success").on("click",function(){swal("Good job!","You clicked the button!","success")});$(".sweet-warning").on("click",function(){swal("Good job!","You clicked the button!","warning")});$(".sweet-error").on("click",function(){swal("Good job!","You clicked the button!","error")});$(".sweet-info").on("click",function(){swal("Good job!","You clicked the button!","info")});$(".sweet-multiple").on("click",function(){swal({title:"Are you sure?",text:"Once deleted, you will not be able to recover this imaginary file!",icon:"warning",buttons:!0,dangerMode:!0}).then(n=>{n?swal("Poof! Your imaginary file has been deleted!",{icon:"success"}):swal("Your imaginary file is safe!",{icon:"error"})})});$(".sweet-prompt").on("click",function(){swal("Write something here:",{content:"input"}).then(n=>{swal(`You typed: ${n}`)})});$(".sweet-ajax").on("click",function(){swal({text:'Search for a movie. e.g. "La La Land".',content:"input",button:{text:"Search!",closeModal:!1}}).then(n=>{if(!n)throw null;return fetch(`https://itunes.apple.com/search?term=${n}&entity=movie`)}).then(n=>n.json()).then(n=>{const t=n.results[0];if(!t)return swal("No movie was found!");const i=t.trackName,r=t.artworkUrl100;swal({title:"Top result:",text:i,icon:r})}).catch(n=>{n?swal("Oh noes!","The AJAX request failed!","error"):(swal.stopLoading(),swal.close())})})});